import React from 'react';
import { connect } from 'react-redux';

import {
  connectToSocket, disconnectFromSocket
} from '../actions/socketActions';
import ClickableArea from './ClickableArea';

let socket;

function GameSession(props) {
  const { error, loading } = props.socket;

  if (error) { return <div>{error}</div>; };
  if (loading) { return <div>Loading...</div>; }
  return (
    <div style={{ textAlign: "center" }}>
      <div onClick={props.connectToSocket}>loooooool</div>
      <ClickableArea />
    </div>
  );

}

function mapStateToProps(state) {
  return {
    socket: state.socket
  };
}

function mapDispatchToProps(dispatch) {
  return {
    connectToSocket: connectToSocket(dispatch),
    disconnectFromSocket: disconnectFromSocket(dispatch)
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(GameSession);
